// STRUCTS
struct Player
{
	// Functions
	void Reset()
	{
		XPos = SCREEN_WIDTH / 2;
		YPos = 5;
		isAccelerating = false;
		acceleration = 0.0f;
		hasLanded = false;
		hasCrashed = false;
		time(&oldTime);		 
	}
	
	// Constants
	static const int WIDTH = 2;
	static const int HEIGHT = 3;
	const int CHARACTERS[WIDTH * HEIGHT] =	{
		'_','_',
		'[', ']',
		'/','\\',
	};
	const int COLOURS[WIDTH * HEIGHT] =	{
		0xF,0xF,
		0xF,0xF,
		0xE,0xE,
	};
			
	// Variables
	int XPos = SCREEN_WIDTH / 2;
	int YPos = 5;
	bool isAccelerating = false;
	float acceleration = 0.0f;
	bool hasLanded = false;
	bool hasCrashed = false;
	float fuel = 100;
	float score = 0.0f;
	time_t newTime;
	time_t oldTime;
	int landingScore = 0.0f;
	int crashingScore = 0.0f;
};

